import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  margin: 0 0 0 280px;
`;

const Logo = styled.div`
  float: left;
`;

const Form = styled.form`
  float: left;
  margin-top: 10px;
  margin-left: 40px;
`;

const Input = styled.input`
  width: 500px;
  border-radius: 5px;
`;

const TopHead = () => {
  return (
    <Container>
      <Logo>
        <img src="../static/logo.png" alt="logo" width="50px" height="50px" />
      </Logo>
      <Form>
        <Input />
      </Form>
    </Container>
  );
};

export default TopHead;
